  [],\n\t\"revision_timestamp\": \"2016-09-24T15:28:51.350876\",\n\t\"name\": \"iclus-v1-3-housing-density-for-the-conterminous-usa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Climate and land-use change are major components
  of global environmental change with feedbacks between these components. The consequences
  of these interactions show that land use may exacerbate or alleviate climate change
  effects. Based on these findings it is important to use land-use scenarios that
  are consistent with the specific assumptions underlying climate-change scenarios.
  The Integrated Climate and Land-Use Scenarios (ICLUS) project developed land-use
  outputs that are based on a downscaled version of the Intergovernmental Panel on
  Climate Change (IPCC) Special Report on Emissions Scenarios (SRES) social, economic,
  and demographic storylines. ICLUS outputs are derived from a pair of models. A demographic
  model generates county-level population estimates that are distributed by a spatial
  allocation model (SERGoM v3) as housing density across the landscape. Land-use outputs
  were developed for the four main SRES storylines and a baseline (\"base case\").
  The model is run for the conterminous USA and output is semi-decadally for each
  scenario to 2100. In addition to housing density at a 1 hectare spatial resolution,
  this project also generated estimates of impervious surface at a resolution of 1
  square kilometer.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
